// components/Homey.js

import React from "react";
import {
    VStack,
    useDisclosure,
    Button,
    Text,
    HStack,
    Select,
    Input,
    Box
  } from "@chakra-ui/react";

const Homey = () => (
  <div>
    <Button> Create a group </Button>
    <Button> Add an expense </Button> 
  </div>
);

export default Homey;
